import React from 'react';
import './App.css';
import OpenLinkWebSDK from './components/OpenLinkWebSDK';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>Mesh App Example</h3>
        <div className="OpenLink">
          <OpenLinkWebSDK />
        </div>
      </header>
      <div>
        <h1>WebSocket Events</h1>
        <div id="events"></div>
      </div>
    </div>
  );
}

export default App;
